import { Card } from "antd";
import "./UspCard.css";

export const UspCard = (props) => {
  const usp = props?.data;
  return (
    <Card className="usp-card" style={{backgroundColor:usp?.backgroundColor}}>
      <div style={{ height: "120px" }}>
        <div className="title">{usp?.title}</div>
        <span className="description">{usp?.description}</span>
      </div>
      <div className="usp-cover">
        <img className="usp-cover-image" src={usp?.image} />
      </div>
    </Card>
  );
};
